import React from 'react'
import { fontSizer, getCols, } from '../utils/utils'

class Products extends React.PureComponent {
    render = () => {
        return (
            <div className="container">

                <style jsx>{`
                    .container {
                        width: 100%;
                        height: 100%;
                    }
                `}</style>
            </div>
        )
    }
}

export default Products
